import { Routes, Route } from "react-router-dom";
import Home from "./views/Home";
import Form from "./views/Form";
import NavBar from "./components/Nav.Bar";

function App() {
  <NavBar />;
  return (
    <Routes>
      <Route path="/home" element={<Home />} />
      <Route path="/form" element={<Form />} />
    </Routes>
  );
}

export default App;
